config.script:
var numPackages = 0;

$.setPortCallback("input",onInput);

function onInput(ctx,s) {
    var msg = {};

    msg.Body = s.Body;

    // Use package number as commit token
    msg.Attributes = {};
    msg.Attributes["message.commit.token"] = numPackages; 
    msg.Attributes["package"] = numPackages;

    $.output(msg);

    numPackages++;
}
